import React, { useState } from 'react'

export default function Search()
{
  const [ show, setShow ] = useState([])

  return (
    <div className={`searchbar ${show ? "show" : ""}`}>
        <input type="text" placeholder="search" />
        <div className="icon">
          <i className="fas fa-search"></i>
        </div>
    </div>
  )
}
